function CarsCard(oneCar) {
    return (
        <div className='cardGeral'>
            {
                cars.map((oneCar) => {
                    return (
                        <Card>
                            <p>{oneCar.BRAND}</p>
                            <p>{oneCar.MODEL}</p>
                            <p>{oneCar.DEALER}</p>
                            <p>{oneCar.MIN_MILEAGE}</p>
                            <p>{oneCar.MAX_MILEAGE}</p>
                        </Card>
                    )
                })
            }
        </div>
    );
}

export default CarsCard;
